Petit coin de paradis non loin de Sainte Enimie...
Caché au regard du monde, Castelbouc est un petit village incrusté dans la roche, presque...troglodyte.
Avec un charme nature...limite magique, il invite à la sérénité.

La légende raconte: "Dans le vieux château, aujourd'hui en ruines, vivait le Seigneur du village au temps des croisades. Lorsque tous les hommes durent partir à la guerre, ce dernier refusa. En compensation, il dut contenter toutes les femmes du village et finit...par mourir d'épuisement.
Il est dit qu'il se réincarna en bouc et le nom du village devint ainsi celui qu'on lui connaît aujourd'hui."

